import Link from 'next/link';

const Navigation = () => (
    <div>
        <Link href="/meditation">
            <a>Destress</a>
        </Link>
        <Link href="/schedule">
            <a>Schedule</a>
        </Link>
        <Link href="/help">
            <a>Find Help</a>
        </Link>
        <Link href="/choco-project">
            <a>The Choco Project</a>
        </Link>

      <style jsx>{`
        div {
          position: absolute;
          top: 0;
          left: 0;
          width: 100vw;
          height: 5vh;
          background: black;
        }
      `}</style>

    </div>
);

export default Navigation;
